            $(window).on("hashchange", function() {
                page = window.location.hash;
                page = parseInt(page.replace("#strona", ""));
                if (isNaN(page)) page = 1;
                getPageObjects(page);
            });
            page = window.location.hash;
            page = parseInt(page.replace("#strona", ""));
            if (isNaN(page) || page === "") page = 1;
